            const dateStart = new Date(startDate + 'T00:00:00');
            const dateEnd = new Date(endDate + 'T23:59:59');
            
            for (const [key, value] of Object.entries(dataSource)) {
                const parts = key.split('_');
                const zona = parts[1];
                const fecha = parts[2];
                const fechaObj = new Date(fecha + 'T00:00:00');
                
                if (zona === selectedZone && fechaObj >= dateStart && fechaObj <= dateEnd) {
                    filteredData[key] = value;
                }
            }
            
            // Calcular KDE para la zona seleccionada
            const plotData = [];
            const spreads = [];
            for (const [key, value] of Object.entries(filteredData)) {
                spreads.push(value);
            }
            
            if (spreads.length > 1) {
                // Calcular KDE usando aproximaci√≥n simple
                spreads.sort((a, b) => a - b);
                const minVal = Math.min(...spreads);
                const maxVal = Math.max(...spreads);
                const x = [];
                const y = [];
                const step = (maxVal - minVal) / 200;
                
                for (let i = 0; i <= 200; i++) {
                    const xVal = minVal + i * step;
                    let density = 0;
                    const bandwidth = (maxVal - minVal) / 10;
                    for (const s of spreads) {
                        const diff = (xVal - s) / bandwidth;
                        density += Math.exp(-0.5 * diff * diff) / (bandwidth * Math.sqrt(2 * Math.PI));
                    }
                    density /= spreads.length;
                    x.push(xVal);
                    // Multiplicar densidad por 10^6 para mostrar valores sin notaci√≥n "u"
                    y.push(density * 1000000);
                }
                
                plotData.push({
                    x: x,
                    y: y,
                    type: 'scatter',
                    mode: 'lines',
                    name: selectedZone,
                    line: {color: '#1f77b4', width: 2}
                });
            }
            
            Plotly.newPlot('plotly-div', plotData, {
                title: {
                    text: 'Distribuci√≥n KDE del Spread - ' + currentMarketKDE + ' - ' + selectedZone,
                    font: {size: 18}
                },
                xaxis: {
                    title: {
                        text: 'Spread ($/MWh)',
                        font: {size: 14}
                    },
                    showgrid: true,
                    gridcolor: 'lightgray',
                    showline: true,
                    mirror: true
                },
                yaxis: {
                    title: {
                        text: 'Densidad de probabilidad √ó10‚Åª‚Å∂',
                        font: {size: 14}
                    },
                    showgrid: true,
                    gridcolor: 'lightgray',
                    showline: true,
                    mirror: true,
                    range: [0, null],
                    tickformat: '.0f',
                    zeroline: false
                },
                template: 'plotly_white',
                hovermode: 'closest',
                autosize: true,
                height: 600,
                margin: {l: 80, r: 40, t: 80, b: 80}
            });
        }
        // Funci√≥n para redimensionar el gr√°fico
        function resizeChartKDE() {
            const plotDiv = document.getElementById('plotly-div');
            if (plotDiv && window.Plotly && window.Plotly.Plots) {
                window.Plotly.Plots.resize(plotDiv);
            }
        }
        
        let chartInitializedKDE = false;
        
        // Escuchar mensajes de resize desde el padre (dashboard)
        window.addEventListener('message', function(event) {
            if (event.data === 'resize') {
                setTimeout(function() {
                    if (chartInitializedKDE && window.Plotly) {
                        resizeChartKDE();
                    } else if (!chartInitializedKDE) {
                        // Si el gr√°fico a√∫n no se ha inicializado, inicializarlo ahora
                        updateChartKDE();
                        chartInitializedKDE = true;
                        setTimeout(resizeChartKDE, 200);
                    }
                }, 100);
            }
        });
        
        // Inicializar el gr√°fico cuando el DOM est√© listo
        document.addEventListener('DOMContentLoaded', function() {
            const plotDiv = document.getElementById('plotly-div');
            if (plotDiv && !chartInitializedKDE) {
                // Inicializar el gr√°fico inmediatamente
                updateChartKDE();
                chartInitializedKDE = true;
                
                // Usar IntersectionObserver para redimensionar cuando se hace visible
                const observer = new IntersectionObserver(function(entries) {
                    entries.forEach(function(entry) {
                        if (entry.isIntersecting && entry.intersectionRatio > 0) {
                            // El contenedor es visible, redimensionar
                            setTimeout(function() {
                                if (window.Plotly) {
                                    resizeChartKDE();
                                }
                            }, 200);
                        }
                    });
                }, { threshold: 0.01 });
                
                observer.observe(plotDiv);
                
                // Tambi√©n intentar redimensionar despu√©s de un delay inicial
                setTimeout(function() {
                    if (window.Plotly) {
                        resizeChartKDE();
                    }
                }, 500);
            }
        });
        </script>
